(7, 1, '2021-12-24 17:02:47', '2021-12-24 17:02:47', '[vc_row kd_background_image_position=\"vc_row-bg-position-top\" css=\".vc_custom_1640367332995{padding-top: 250px !important;padding-bottom: 250px !important;background-image: url(https://adstechnolab.com/dev/autoatelier/wp-content/uploads/2021/12/Banner.jpg?id=18) !important;background-position: center !important;background-repeat: no-repeat !important;background-size: cover !important;}\"][vc_column][vc_row_inner kd_background_image_position=\"vc_row-bg-position-top\"][vc_column_inner width=\"1/2\"][vc_custom_heading text=\"Auto Atelier\" use_theme_fonts=\"yes\" css_animation=\"fadeInUp\"][vc_custom_heading text=\"Lsst Ihr Herz hher schlagen\" font_container=\"tag:h3|text_align:left\" use_theme_fonts=\"yes\" css_animation=\"fadeInUp\"][tek_button button_text=\"Unsere Services\" button_style=\"tt_primary_button\" button_color_scheme=\"btn_primary_color\" button_hover_state=\"\" button_icon_bool=\"yes\" button_icon_position=\"icon_right\" button_action=\"button-action-link\" button_position=\"btn-align-left\" css_animation=\"kd-animated fadeInUp\" icons=\"fas fa-arrow-right\"][tek_button button_text=\"Kontakt\" button_style=\"tt_secondary_button\" button_color_scheme=\"btn_primary_color\" button_hover_state=\"\" button_icon_bool=\"yes\" button_icon_position=\"icon_right\" button_action=\"button-action-link\" button_position=\"btn-align-left\" css_animation=\"kd-animated fadeInUp\" icons=\"fas fa-arrow-right\"][/vc_column_inner][vc_column_inner width=\"1/2\"][/vc_column_inner][/vc_row_inner][/vc_column][/vc_row][vc_row kd_background_image_position=\"vc_row-bg-position-top\"][vc_column][vc_custom_heading text=\"Das Auto, eine Liebesgeschichte.\" use_theme_fonts=\"yes\" css_animation=\"fadeInUp\"][vc_column_text css_animation=\"fadeInUp\"]Ein Auto ist mehr als ein fahrbarer Untersatz. Es zeigt den Zeitgeist\r\nund wer wir sind. Unsere Autos lassen Ihr Herz hher schlagen.\r\n\r\nSie trumen vom nchsten Alltagswagen, schnellen Sportflitzer oder sehnen sich nach dem neuesten SUV? Wir bei Auto Atelier in Zrich Schlieren haben eine handverlesene Auswahl an Autos: von Ferrari ber Bentley bis hin zu alltagstauglichen Renault, um nur einige zu nennen. Kommen Sie unverbindlich in unserem Showroom vorbei und lassen sich inspirieren.[/vc_column_text][vc_row_inner kd_background_image_position=\"vc_row-bg-position-top\"][vc_column_inner width=\"1/3\"][vc_custom_heading text=\"01\" font_container=\"tag:h3|text_align:left\" use_theme_fonts=\"yes\" css_animation=\"fadeInUp\"][vc_custom_heading text=\"Ankauf &amp; Verkauf\" font_container=\"tag:h4|text_align:left\" use_theme_fonts=\"yes\" css_animation=\"fadeInUp\"][vc_column_text css_animation=\"fadeInUp\"]In Unserem Showroom in Zrich Schlieren finden Sie ausgewhlte Autos zu fairen Preisen.\r\n\r\n<strong>Unsere Strke:</strong> wir decken smtliche Marken der Automobilwelt ab.[/vc_column_text][tek_button button_text=\"Unsere Autos\" button_style=\"tt_secondary_button\" button_color_scheme=\"btn_primary_color\" button_hover_state=\"\" button_icon_bool=\"yes\" button_icon_position=\"icon_right\" button_action=\"button-action-link\" button_position=\"btn-align-left\" css_animation=\"kd-animated fadeInUp\" icons=\"fas fa-arrow-right\"][/vc_column_inner][vc_column_inner width=\"1/3\"][vc_custom_heading text=\"02\" font_container=\"tag:h3|text_align:left\" use_theme_fonts=\"yes\" css_animation=\"fadeInUp\"][vc_custom_heading text=\"Suchauftrag\" font_container=\"tag:h4|text_align:left\" use_theme_fonts=\"yes\" css_animation=\"fadeInUp\"][vc_column_text css_animation=\"fadeInUp\"]Dank unserer langjhrigen Erfahrung und Netzwerk sind wir in der Lage, welweit das gewnscht Auto fr Sie zu finden.\r\n\r\nSoll es ein seltener Ferrari sein oder ein einzigartiger VW Golf? Wir sind der richtige Partner dafr![/vc_column_text][tek_button button_text=\"Kontakt\" button_style=\"tt_secondary_button\" button_color_scheme=\"btn_primary_color\" button_hover_state=\"\" button_icon_bool=\"yes\" button_icon_position=\"icon_right\" button_action=\"button-action-link\" button_position=\"btn-align-left\" css_animation=\"kd-animated fadeInUp\" icons=\"fas fa-arrow-right\"][/vc_column_inner][vc_column_inner width=\"1/3\"][vc_custom_heading text=\"03\" font_container=\"tag:h3|text_align:left\" use_theme_fonts=\"yes\" css_animation=\"fadeInUp\"][vc_custom_heading text=\"Eventlocation\" font_container=\"tag:h4|text_align:left\" use_theme_fonts=\"yes\" css_animation=\"fadeInUp\"][vc_column_text css_animation=\"fadeInUp\"]Mieten Sie unseren exklusiven Showroom in Zrich Schlieren fr Ihren nchsten Anlass.\r\n\r\n<strong>Ausstattung:</strong> 400m2 Flche insgesamt, Soround System. 400m2 Flche insgesamt, Soround System. 400m2 Flche insgesamt, Soround System.[/vc_column_text][vc_single_image image=\"31\" img_size=\"full\" alignment=\"center\" css_animation=\"fadeInUp\"][tek_button button_text=\"Kontakt\" button_style=\"tt_secondary_button\" button_color_scheme=\"btn_primary_color\" button_hover_state=\"\" button_icon_bool=\"yes\" button_icon_position=\"icon_right\" button_action=\"button-action-link\" button_position=\"btn-align-left\" css_animation=\"kd-animated fadeInUp\" icons=\"fas fa-arrow-right\"][/vc_column_inner][/vc_row_inner][/vc_column][/vc_row][vc_row content_placement=\"middle\" kd_background_image_position=\"vc_row-bg-position-top\"][vc_column width=\"4/12\"][vc_single_image image=\"33\" img_size=\"full\" alignment=\"center\"][/vc_column][vc_column width=\"8/12\"][vc_custom_heading text=\"Bei Auto Atelier mit\r\nCryptowhrungen bezahlen\" use_theme_fonts=\"yes\" css_animation=\"fadeInUp\"][vc_column_text css_animation=\"fadeInUp\"]Kaufen Sie ihr nchsten Auto mit einer Cryptowhrung. Exklusiv bei Auto Atelier.\r\n\r\nWir nehmen alle gngigen Cryptowhrung an. Von Bitcoin ber Etherum bis hin zu Solana oder Cardano. Setzen Sie sich unverbindlich mit uns in Kontakt. Wir finden gemeinsam die beste Lsung fr Sie.[/vc_column_text][/vc_column][/vc_row][vc_row content_placement=\"middle\" kd_background_image_position=\"vc_row-bg-position-top\"][vc_column][vc_row_inner kd_background_image_position=\"vc_row-bg-position-top\"][vc_column_inner width=\"3/12\"][/vc_column_inner][vc_column_inner width=\"9/12\"][vc_custom_heading text=\"Wir sind Fabio und Roberto\" use_theme_fonts=\"yes\" css_animation=\"fadeInUp\"][vc_column_text css_animation=\"fadeInUp\"]Ein Auto ist mehr als ein fahrbarer Untersatz. Es zeigt den Zeitgeist und wer wir sind. Unsere Autos lassen Ihr Herz hher schlagen. Sie trumen vom nchsten Alltagswagen, schnellen Sportflitzer oder sehnen sich nach dem neuesten SUV? Wir bei Auto Atelier in Zrich Schlieren haben eine handverlesene Auswahl an Autos: von Ferrari ber Bentley bis hin zu alltagstauglichen Renault, um nur einige zu nennen. Kommen Sie unverbindlich in unserem Showroom vorbei und lassen sich inspirieren.[/vc_column_text][/vc_column_inner][/vc_row_inner][vc_row_inner kd_background_image_position=\"vc_row-bg-position-top\"][vc_column_inner width=\"1/2\"][vc_single_image image=\"35\" img_size=\"full\" alignment=\"center\" onclick=\"link_image\" css_animation=\"fadeInUp\"][/vc_column_inner][vc_column_inner width=\"1/2\"][vc_single_image image=\"35\" img_size=\"full\" alignment=\"center\" onclick=\"link_image\" css_animation=\"fadeInUp\"][/vc_column_inner][/vc_row_inner][vc_row_inner kd_background_image_position=\"vc_row-bg-position-top\"][vc_column_inner width=\"1/2\"][vc_single_image image=\"35\" img_size=\"full\" alignment=\"center\" onclick=\"link_image\" css_animation=\"fadeInUp\"][/vc_column_inner][vc_column_inner width=\"1/2\"][vc_single_image image=\"35\" img_size=\"full\" alignment=\"center\" onclick=\"link_image\" css_animation=\"fadeInUp\"][/vc_column_inner][/vc_row_inner][/vc_column][/vc_row][vc_row kd_background_image_position=\"vc_row-bg-position-top\"][vc_column][vc_row_inner kd_background_image_position=\"vc_row-bg-position-top\"][vc_column_inner width=\"1/2\"][vc_custom_heading text=\"Kontaktieren Sie uns\" use_theme_fonts=\"yes\" css_animation=\"fadeInUp\"][vc_column_text css_animation=\"fadeInUp\"]Schnell und unverbindlich.\r\nWir finden die passende Lsung fr Sie.[/vc_column_text][contact-form-7 id=\"6\"][/vc_column_inner][vc_column_inner width=\"1/2\"][vc_custom_heading text=\"Besuchen Sie uns\r\nIm Showroom\" use_theme_fonts=\"yes\" css_animation=\"fadeInUp\"][vc_gmaps link=\"#E-8_\"][vc_column_text css_animation=\"fadeInUp\"]<strong>Auto Atelier AG</strong>\r\nUnterrohrstrasse 5\r\n8952 Schlieren[/vc_column_text][vc_column_text css_animation=\"fadeInUp\"]Tel.: <a href=\"tel:0449991986\">044 999 19 86</a>\r\nE-Mail: <a href=\"mailto:info@autoatelier-zh.ch\">info@autoatelier-zh.ch</a>[/vc_column_text][vc_column_text css_animation=\"fadeInUp\"]<strong>ffnungszeiten</strong>\r\nMO-FR: 08:00-18:00\r\nSA: 10:00-16:00[/vc_column_text][/vc_column_inner][/vc_row_inner][/vc_column][/vc_row]', 'Home', '', 'publish', 'closed', 'closed', '', 'home', '', '', '2021-12-24 18:49:13', '2021-12-24 18:49:13', '', 0, 'https://adstechnolab.com/dev/autoatelier/?page_id=7', 0, 'page', '', 0),
